import VueRouter from "vue-router";

import AboutLearn from '../pages/AboutLearn.vue'
import AboutWork from '../pages/AboutWork.vue'
import AboutLife from '../pages/AboutLife.vue'
import JSinfo from '../pages/JSinfo.vue'
import CSSinfo from '../pages/CSSinfo.vue'

export default new VueRouter({
    routes:[
        {
            path:'/aboutlearn',
            component:AboutLearn,
            children: [
                {
                  // UserProfile will be rendered inside User's <router-view>
                  // when /user/:id/profile is matched
                  path: 'js',
                  component: JSinfo
                },
                {
                  // UserPosts will be rendered inside User's <router-view>
                  // when /user/:id/posts is matched
                  path: 'css',
                  component: CSSinfo
                }
              ]
        },
        {
            path:'/aboutwork',
            component:AboutWork,
            
        },
        {
            path:'/aboutlife',
            component:AboutLife
        }
    ]
})
